INSERT INTO `fc_provedor` (`id_provedorfc`, `datatime_provedorfc`, `nome_provedorfc`, `pessoa_juridica_provedorfc`, `razao_social_provedorfc`, `rg_ie_provedorfc`, `cpf_cnpj_provedorfc`, `responsavel_provedorfc`, `endereco1_provedorfc`, `numero1_provedorfc`, `complemento1_provedorfc`, `cep1_provedorfc`, `bairro1_provedorfc`, `cidade1_provedorfc`, `uf1_provedorfc`, `endereco2_provedorfc`, `numero2_provedorfc`, `complemento2_provedorfc`, `cep2_provedorfc`, `bairro2_provedorfc`, `cidade2_provedorfc`, `uf2_provedorfc`, `telefone_provedorfc`, `telefone2_provedorfc`, `telefone3_provedorfc`, `email_provedorfc`, `site_provedorfc`, `licenca_provedorfc`, `encargos_provedorfc`, `bloqueios_provedorfc`, `dias_bloqueio_auto_provedorfc`, `valor_min_bloqueio_provedorfc`, `porcentagem_desbloqueio_provedorfc`, `porcentagem_desconto_bloqueio_provedorfc`, `dias_nao_receber_provedorfc`, `valor_desconto_provedorfc`, `porcentagem_desconto_provedorfc`, `dias_desconto_bloqueio_provedorfc`, `dias_desconto_provedorfc`, `dias_multa_juros_provedorfc`, `porcentagem_juros_provedorfc`, `porcentagem_multa_provedorfc`, `email_send_provedorfc`, `host_contaemail_provedorfc`, `user_contaemail_provedorfc`, `senha_contaemail_provedorfc`, `texto_contrato_provedorfc`, `texto_comodato_provedorfc`, `texto_recibo_provedorfc`, `texto_nadaconsta_provedorfc`, `email_recibo_provedorfc`, `email_cobranca_provedorfc`, `sit_provedorfc`, `apelido_provedorfc`) VALUES
(2, '0000-00-00 00:00:00', 'TECNET INFORMÁTICA', 'on', 'ANDRÉ MARTINS BRANDÃO - MEI', '', '25371096000125', 'ANDRÉ MARTINS BRANDÃO', 'R. JERONIMO DE ALBUQUERQUE', '1859', 'FUNDOS', '79017121', 'NOVA LIMA', 'CAMPO GRANDE', 'MS', '', '', '', '', '', '', '', '(67)991397194', '(67) 99202-0992', '', 'tecnetcg@gmail.com', 'http://www.tecnetcg.com', 'ato ° 8045 de 03/10/2014', '', '', 15, 20, 50, 70, 28, 0, 0, 10, 0, 5, 0.33, 2, 'tecnetcg@gmail.com', 'smtp.gmail.com', 'tecnetcg@gmail.com', 'amb142536', '<div class=\"quebrapagina\">\n<div style=\"border-right: medium none; padding-right: 0cm; border-top: medium none; padding-left: 0cm; padding-bottom: 1pt; border-left: medium none; padding-top: 0cm; border-bottom: 1pt solid\">\n<p class=\"MsoNormal\" style=\"border-right: medium none; padding-right: 0cm; border-top: medium none; padding-left: 0cm; padding-bottom: 0cm; border-left: medium none; padding-top: 0cm; border-bottom: medium none; text-align: center\" align=\"center\"><b><span style=\"font-size: 14pt; font-family: Verdana\">Contrato de Prestação de Serviços de Conexão à Internet</span></b><b><span style=\"font-size: 8pt; font-family: Verdana\"> </span></b></p>\n</div>\n<p style=\"text-align: center\" align=\"center\"><b><span style=\"font-size: 8pt; font-family: Verdana\">TERMO DE&nbsp;USO %termo%</span></b><strong><br>\n</strong></p>\n<p style=\"text-align: justify\"><b><span style=\"font-size: 9pt; font-family: Verdana\">%provedornome%</span></b><span style=\"font-size: 9pt; font-family: Verdana\">, inscrita no C.N.P.J. sob nº <b>%provedorcnpj%</b>, com sede a <b>%provedorendereco%</b> - </span><span style=\"font-size: 9pt; font-family: Verdana\"><b>%provedorbairro%</b></span><span style=\"font-size: 9pt; font-family: Verdana\"> - </span><span style=\"font-size: 9pt; font-family: Verdana\"><b>%provedorcidade%</b></span><span style=\"font-size: 9pt; font-family: Verdana\"> - </span><span style=\"font-size: 9pt; font-family: Verdana\"><b>%provedorestado%</b></span><span style=\"font-size: 9pt; font-family: Verdana\">, doravante designada simplesmente CONTRATADA e <b>%nomecliente%</b>, residente à <b>%enderecocliente%</b> - </span><span style=\"font-size: 9pt; font-family: Verdana\"><b>%bairrocliente%</b></span><span style=\"font-size: 9pt; font-family: Verdana\"> - </span><span style=\"font-size: 9pt; font-family: Verdana\"><b>%cidadecliente%</b></span><span style=\"font-size: 9pt; font-family: Verdana\"> - </span><span style=\"font-size: 9pt; font-family: Verdana\"><b>%estadocliente%</b></span><span style=\"font-size: 9pt; font-family: Verdana\">, CPF <b>%cpfcliente%</b>, doravante denominado simplesmente CONTRATANTE, celebram o presente contrato de prestação de serviços que se regerá pelas seguintes cláusulas e condições:</span></p>\n<p style=\"text-align: justify\">&nbsp;<b><span style=\"font-size: 9pt; font-family: Verdana\">1. OBJETO</span></b><strong><br>\n</strong></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">O objeto do </span><span style=\"font-size: 9pt; font-family: Verdana\">presente contrato é</span><strong> </strong><span style=\"font-size: 9pt; font-family: Verdana\">a prestação, pela CONTRATADA ao CONTRATANTE, os serviços de conexão à rede mundial de computadores (INTERNET), através de rede Wireless.</span></p>\n<p style=\"text-align: justify\"><b><span style=\"font-size: 9pt; font-family: Verdana\">2. DISPONIBILIDADE DO SERVIÇO</span></b></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">2.1 - O serviço estará disponível 24 (vinte e quatro) horas por dia, 7 (sete) dias por semana, ressalvada a ocorrência de interrupções devido a:</span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify\"><span class=\"conteudointerno\"><span style=\"font-size: 9pt; font-family: Verdana\">a) falta de fornecimento de energia elétrica para a CONTRATADA;</span></span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\"><br>\n<span class=\"conteudointerno\">b) falha dos serviços de responsabilidade da operadora de serviços telefônicos;</span></span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\"><br>\n<span class=\"conteudointerno\">c) ocorrências de falhas no sistema de transmissão no acesso à Internet;</span></span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\"><br>\n<span class=\"conteudointerno\">d) manutenção técnica dos equipamentos e/ ou operacionais que exijam o desligamento temporário do sistema de transmissão de dados;</span></span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\"><br>\n<span class=\"conteudointerno\">e) ação de terceiros que impeça a prestação dos serviços e</span></span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\"><br>\n<span class=\"conteudointerno\">f) casos fortuitos ou força maior.</span></span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\"><br>\n<span class=\"conteudointerno\">g) A interrupção na prestação dos serviços, pelos motivos relacionados acima, que ultrapassarem tempo superior a 72 (setenta e duas) horas consecutivas, será descontado proporcionalmente os valores referentes a esse período de paralisação.</span></span></p>\n<p class=\"MsoNormal\" style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\"><br>\n<span class=\"conteudointerno\"><b>3 ? LOGIN E SENHA DO CONTRATANTE</b></span></span></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">3.1 - Ao contratar os serviços da <span class=\"conteudointerno\">CONTRATADA</span> o CONTRATANTE receberá um login e uma senha privativa que constituem sua identificação para uso do serviço.</span></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">3.2 - O CONTRATANTE terá apenas um login e uma senha privativa, que são pessoais e intransferíveis.</span></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">3.3 - O CONTRATANTE assume integral responsabilidade por quaisquer prejuízos que cause a terceiros ou venha sofrer pela utilização indevida de seu código ou de sua senha privativa.</span></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">3.4 - Não serão permitidas conexões simultâneas utilizando o mesmo login de CONTRATANTE e a mesma senha privativa de acesso aos serviços.</span></p>\n<p class=\"MsoNormal\"><b><span style=\"font-size: 9pt; font-family: Verdana\">4 - TAXA DE INSTALAÇÃO E PRAZO DE VIGÊNCIA <br>\n</span></b><b><span style=\"font-size: 9pt; font-family: Verdana\"><br>\n</span></b><span style=\"font-size: 9pt; font-family: Verdana\">A instalação do serviço denominado internet tem um custo de inscrição declarado depois de feita viabilidade para levar o acesso a Internet até o computador do CONTRATANTE. </span></p>\n<p class=\"MsoNormal\"><span style=\"font-size: 9pt; font-family: Verdana\"><br>\n</span><span style=\"font-size: 9pt; font-family: Verdana\">4.1&nbsp;Não há&nbsp;prazo mínimo de vigência do presente CONTRATO&nbsp;.</span></p>\n<p class=\"MsoNormal\"><span style=\"font-size: 9pt; font-family: Verdana\"><br>\n</span><span style=\"font-size: 9pt; font-family: Verdana\">4.2 O cliente poderá bloquear a assinatura por até 30 dias. Caso ultrapasse esse limite para desbloqueá-lo, o cliente pagará uma taxa de adesão acordada com a CONTRATADA.</span></p>\n<p class=\"MsoNormal\"><span style=\"font-size: 9pt; font-family: Verdana\"><br>\n</span><b><span style=\"font-size: 9pt; font-family: Verdana\">5 - PAGAMENTO E REAJUSTE</span></b></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">5.1 - O pagamento pela utilização do serviço será realizado mensalmente à vencer, o dia do vencimento será o que consta no objeto de cobrança, incluindo tributos e demais encargos conforme a legislação em vigor.</span></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">5.2 - O não pagamento no vencimento sujeitará o usuário, a exclusivo critério da <span class=\"conteudointerno\">CONTRATADA</span>, independentemente de notificação judicial ou extrajudicial, na suspensão da prestação dos serviços.</span></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">* A suspensão dos serviços por falta de pagamento, não implica no cancelamento ou suspensão do respectivo contrato.</span></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">5.3 - O preço contratado será reajustado anualmente, ou em prazo inferior que vier a ser admitido pela legislação aplicável, pela variação do I.G.P.-M, ou por outro índice que venha a substituí-lo.</span></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">5.4 - Estes valores também poderão ser revistos, a qualquer tempo, para o resgate do inicial equilíbrio econômico-financeiro necessário à prestação dos Serviços ou em caso de modificações do regime tributário vigente.</span></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">5.5 - O atraso no pagamento da mensalidade nos prazos e pelos valores ajustados, será cobrado juros de mora de 1% (um por cento) ao mês, correção monetária pela variação do I.G.P.-M e multa de 2% (dois por cento) sobre os valores devidos e não pagos.</span></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">5.6 - O não pagamento de qualquer parcela devida pela contratante dará a <span class=\"conteudointerno\">CONTRATADA</span> o direito de interromper a prestação do serviço de acesso do usuário, até a efetivação do pagamento, independente de aviso prévio.</span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 12pt; text-align: justify\"><span class=\"conteudointerno\"><b><span style=\"font-size: 9pt; font-family: Verdana\">6. FORMA DE UTILIZAÇÃO DOS SERVIÇOS</span></b></span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 12pt; text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">6<span class=\"conteudointerno\">.1 - Ao contratar os serviços o CONTRATANTE se obriga a respeitar a legislação em vigor de utilização da rede Internet, devendo abster-se de:</span></span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 12pt; text-align: justify\"><span class=\"conteudointerno\"><span style=\"font-size: 9pt; font-family: Verdana\">a) acessar senhas, modificar dados privativos, arquivos ou assumir identidade de terceiros;</span></span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 12pt; text-align: justify\"><span class=\"conteudointerno\"><span style=\"font-size: 9pt; font-family: Verdana\">b) desrespeitar leis de direito autoral e de propriedade intelectual;</span></span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 12pt; text-align: justify\"><span class=\"conteudointerno\"><span style=\"font-size: 9pt; font-family: Verdana\">c) transmitir ou armazenar qualquer tipo de material cujo conteúdo infrinja a Lei em vigor, relacionado com drogas, crianças e adolescentes em cena de sexo explícito ou pornografia;</span></span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 12pt; text-align: justify\"><span class=\"conteudointerno\"><span style=\"font-size: 9pt; font-family: Verdana\">d) divulgar informações falsas ou incompletas de caráter sigiloso;</span></span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 12pt; text-align: justify\"><span class=\"conteudointerno\"><span style=\"font-size: 9pt; font-family: Verdana\">e) prejudicar usuários da INTERNET, através do uso de programas, acessando computadores, alterando arquivos, programas e dados existentes na rede;</span></span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 12pt; text-align: justify\"><span class=\"conteudointerno\"><span style=\"font-size: 9pt; font-family: Verdana\">f) estimular a prática de condutas ilícitas ou contrárias à moral e aos bons costumes, bem como, atos discriminatórios de cunho sexual, racial, religioso ou qualquer outra condição.</span></span></p>\n<p class=\"MsoNormal\" style=\"margin-bottom: 12pt; text-align: justify\"><span class=\"conteudointerno\"><span style=\"font-size: 9pt; font-family: Verdana\">g) Divulgar ou anunciar produtos e serviços através de correio eletrônico, salvo nos acasos de expressa do destinatário a CONTRATADA.</span></span></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">6.2 - A <span class=\"conteudointerno\">CONTRATADA</span> poderá, sem qualquer aviso prévio, suspender ou impedir a divulgação de material, quando for considerado ilegal, impróprio ou determinado por autoridade Federal, Estadual ou Municipal, comunicando o fato imediatamente ao CONTRATANTE.</span></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">6.3 - Cabe exclusivamente ao usuário a aquisição dos equipamentos, e manutenção¹, terminais e suas interfaces com as redes de telecomunicação, necessários à utilização dos serviços.</span></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">6.4 - Quaisquer alterações nas condições da prestação dos serviços serão previamente comunicadas ao CONTRATANTE, sempre que for possível.</span></p>\n<p style=\"text-align: right\" align=\"right\"><b><sup><span style=\"font-size: 9pt; font-family: Verdana\">(1)</span></sup></b><b><i><span style=\"font-size: 7pt; font-family: Verdana\"> Apenas para equipamentos adquiridos por terceiros.</span></i></b></p>\n<p style=\"text-align: justify\"><b><span style=\"font-size: 9pt; font-family: Verdana\">7. RISCOS NA UTILIZAÇÃO DA INTERNET</span></b></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">7.1 - A <span class=\"conteudointerno\">CONTRATADA</span> não se responsabilizará por qualquer dano ou prejuízo direto ou indireto que o CONTRATANTE venha a sofrer, ou que cause a terceiros, como conseqüência da utilização da INTERNET. Perda total ou parcial de informações, arquivos ou de programas contaminados por vírus, clonagem ou cópia do número de cartão de crédito, contas bancárias e suas respectivas senhas, fraude na compra de produtos e serviços pela Internet, como não entrega ou não prestação de serviços contratados.</span></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">7.2 - É de exclusiva responsabilidade do CONTRATANTE prevenir-se dos riscos mencionados e de outros advindos da INTERNET.</span></p>\n<p style=\"text-align: justify\"><b><span style=\"font-size: 9pt; font-family: Verdana\">8. PRAZO E DA EXTINÇÃO DO PRESENTE CONTRATO</span></b></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">8.1 - O presente contrato é celebrado por prazo indeterminado, podendo quaisquer das partes promover a sua extinção mediante aviso prévio com antecedência mínima de 30 (trinta) dias durante os quais as partes se comprometem a cumprir integralmente as obrigações contratuais.</span></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">8.2 - O presente contrato poderá ser rescindido, de forma imediata e sem qualquer aviso prévio, sempre que uma das partes violar quaisquer dispositivos constantes neste instrumento ou contrária à legislação vigente.</span></p>\n<p style=\"text-align: justify\"><b><span style=\"font-size: 9pt; font-family: Verdana\">9. NORMAS APLICÁVEIS, FORO E DISPOSIÇÕES GERAIS.</span></b></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">9.1 - O presente Contrato será regido pelas leis brasileiras,</span></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">9.2 - O CONTRATANTE reconhece e declara que leu e que está ciente e de pleno acordo com todos os termos e condições deste contrato.</span></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">9.3 - Para dirimir toda e qualquer demandam envolvendo o presente contrato e seu objeto, fica eleito o foro da Comarca de </span><span style=\"font-size: 9pt; font-family: Verdana\">%provedorcidade%, </span><span style=\"font-size: 9pt; font-family: Verdana\">com expressa renúncia de qualquer outro, por mais especial que seja.</span></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">&nbsp;</span></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">Por estarem assim justos e contratados, firmam o presente instrumento, em duas vias de igual teor.</span></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">&nbsp;</span></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">&nbsp;</span></p>\n<p style=\"text-align: right\" align=\"right\"><span style=\"font-size: 9pt; font-family: Verdana\">%provedorcidade%, %data%</span></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">&nbsp;</span></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">&nbsp;</span></p>\n<div align=\"center\">\n<table class=\"MsoNormalTable\" style=\"border-collapse: collapse\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\">\n    <tbody>\n        <tr>\n            <td style=\"padding-right: 5.4pt; padding-left: 5.4pt; padding-bottom: 0cm; width: 264.5pt; padding-top: 0cm\" valign=\"top\" width=\"353\">\n            <p class=\"MsoNormal\" style=\"text-align: center\" align=\"center\"><span style=\"font-size: 9pt; font-family: Verdana\">_____________________________________</span></p>\n            </td>\n            <td style=\"padding-right: 5.4pt; padding-left: 5.4pt; padding-bottom: 0cm; width: 264.5pt; padding-top: 0cm\" valign=\"top\" width=\"353\">\n            <p class=\"MsoNormal\" style=\"text-align: center\" align=\"center\"><span style=\"font-size: 9pt; font-family: Verdana\">_____________________________________</span></p>\n            </td>\n        </tr>\n        <tr>\n            <td style=\"padding-right: 5.4pt; padding-left: 5.4pt; padding-bottom: 0cm; width: 264.5pt; padding-top: 0cm\" valign=\"top\" width=\"353\">\n            <p class=\"MsoNormal\" style=\"text-align: center\" align=\"center\"><span style=\"font-size: 9pt; font-family: Verdana\">Contratante</span></p>\n            </td>\n            <td style=\"padding-right: 5.4pt; padding-left: 5.4pt; padding-bottom: 0cm; width: 264.5pt; padding-top: 0cm\" valign=\"top\" width=\"353\">\n            <p class=\"MsoNormal\" style=\"text-align: center\" align=\"center\"><span style=\"font-size: 9pt; font-family: Verdana\">Contratada</span></p>\n            </td>\n        </tr>\n    </tbody>\n</table>\n</div>\n</div>\n<div class=\"Section1\">&nbsp;</div>\n<p>&nbsp;</p> \n\n', '<div class=\"quebrapagina\">\n<div style=\"border-right: medium none; padding-right: 0cm; border-top: medium none; padding-left: 0cm; padding-bottom: 1pt; border-left: medium none; padding-top: 0cm; border-bottom: 1pt solid\">\n<p class=\"MsoNormal\" style=\"border-right: medium none; padding-right: 0cm; border-top: medium none; padding-left: 0cm; padding-bottom: 0cm; border-left: medium none; padding-top: 0cm; border-bottom: medium none; text-align: center\" align=\"center\"><b><span style=\"font-size: 14pt; font-family: Verdana\">CONTRATO DE COMODATO DE EQUIPAMENTO DE RADIAÇÃO RESTRITA</span></b><b><span style=\"font-size: 8pt; font-family: Verdana\"> </span></b></p>\n</div>\n<p style=\"text-align: center\" align=\"center\"><b><span style=\"font-size: 8pt; font-family: Verdana\">TERMO DE&nbsp;USO %termo%</span></b><strong><br>\n</strong></p>\n<p style=\"text-align: justify\"><b><span style=\"font-size: 9pt; font-family: Verdana\">%provedornome%</span></b><span style=\"font-size: 9pt; font-family: Verdana\">, inscrita no C.N.P.J. sob nº <b>%provedorcnpj%</b>, com sede a <b>%provedorendereco%</b> - </span><span style=\"font-size: 9pt; font-family: Verdana\"><b>%provedorbairro%</b></span><span style=\"font-size: 9pt; font-family: Verdana\"> - </span><span style=\"font-size: 9pt; font-family: Verdana\"><b>%provedorcidade%</b></span><span style=\"font-size: 9pt; font-family: Verdana\"> - </span><span style=\"font-size: 9pt; font-family: Verdana\"><b>%provedorestado%</b></span><span style=\"font-size: 9pt; font-family: Verdana\">, doravante designada simplesmente COMODANTE e <b>%nomecliente%</b>, residente à <b>%enderecocliente%</b> - </span><span style=\"font-size: 9pt; font-family: Verdana\"><b>%bairrocliente%</b></span><span style=\"font-size: 9pt; font-family: Verdana\"> - </span><span style=\"font-size: 9pt; font-family: Verdana\"><b>%cidadecliente%</b></span><span style=\"font-size: 9pt; font-family: Verdana\"> - </span><span style=\"font-size: 9pt; font-family: Verdana\"><b>%estadocliente%</b></span><span style=\"font-size: 9pt; font-family: Verdana\">, CPF <b>%cpfcliente%</b>, doravante denominado simplesmente COMODATARIO, celebram o presente contrato de COMODATO que se regerá pelas seguintes cláusulas e condições:</span></p><p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">Para fins de aceite deste contrato, onde contém as informações mínimas necessárias referidas nas cláusulas aqui apresentadas; resolvem em comum acordo, firmar o presente CONTRATO DE COMODATO DE EQUIPAMENTO DE RADIAÇÃO RESTRITA; vinculado a qualquer CONTRATO DE PRESTAÇÃO DE SERVIÇO ADICIONADO PARA ACESSO A INTERNET firmado entre as partes; mediante as cláusulas e condições seguintes:</span></p><p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\"><br></span></p>\n<p style=\"text-align: justify\"><b><span style=\"font-size: 9pt; font-family: Verdana\">1. OBJETO</span></b><strong><br>\n</strong></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">1.1 O Presente contrato tem como OBJETO, a transferência, pela COMODANTE ao COMODATÁRIO, dos direitos de uso e gozo do equipamento de radiação restrita, devidamente descrito na “CAC”.<br>&nbsp;<br>Parágrafo único. O equipamento de radiação restrita, objeto deste contrato, será utilizado para que o COMODATÁRIO possa fazer uso de um meio radioelétrico para seu acesso à Internet, nas condições estabelecidas e enquanto durar qualquer CONTRATO DE PRESTAÇÃO DE VALOR ADICIONADO PARA ACESSO À INTERNET vinculado a este, com a COMODANTE.<br><br></span><span style=\"font-size: 9pt; font-family: Verdana\"></span></p>1.2 O equipamento será disponibilizado no endereço indicado na “CAC”, no qual o COMODATÁRIO se compromete a disponibilizar local próprio, protegido, com energia elétrica 110V estabilizada,e passagem para os cabos necessários para que se possa efetuar a instalação de uma antena ou outro equipamento através de sua fixação em ponto onde ocorra as condições técnicas necessárias ao seu perfeito funcionamento.<br>&nbsp;<br><b>2<span style=\"font-size: 9pt; font-family: Verdana\">. </span>CLÁUSULA SEGUNDA – DAS OBRIGAÇÕES DO COMODATÁRIO</b><br>&nbsp;<br>2.1 A manutenção dos equipamentos de propriedade do COMODANTE será de inteira responsabilidade do COMODATÁRIO.<br>&nbsp;<br>2.2 O COMODATÁRIO assume a inteira responsabilidade na qualidade de fiel depositário pela guarda e integridade dos equipamentos de propriedade do COMODATANTE.<br>&nbsp;<br>2.3 Os equipamentos colocados à disposição do COMODATÁRIO devem ser utilizados exclusivamente nos endereços para os quais foi solicitado, não sendo permitido utilizá-los para cedê-los a terceiros.<br>&nbsp;<br>2.4 Permitir às pessoas indicadas pela COMODANTE acesso às dependências onde estão instalados os equipamentos em regime de comodato de propriedade desta, com a presença de pessoa devidamente autorizada pelo COMODATÁRIO.<br>&nbsp;<br>2.5 O COMODATÁRIO tem inteira responsabilidade pela integração da solução de que trata este contrato com a sua rede interna e reconhece que o COMODANTE não tem obrigação ou responsabilidade de configurar, dar manutenção ou reparar qualquer problema além do equipamento do COMODANTE.<br>&nbsp;<br><b>3. CLÁUSULA TERCEIRA – DA DEVOLUÇÃO</b><br>&nbsp;<br>3.1 O COMODATÁRIO deverá devolver os equipamentos à COMODANTE após cancelamento ou rescisão de qualquer CONTRATO DE PRESTAÇÃO DE SERVIÇO DE VALOR ADICIONADO PARA ACESSO A INTERNET vinculado a este, nas mesmas condições em que estava quando o recebeu, ou seja, em perfeitas condições de uso, respondendo pelos danos ou prejuízos causados.<br>&nbsp;<br>Parágrafo Único. Ficam ressalvados os desgastes naturais por tempo de uso.<br>&nbsp;<br>3.2&nbsp; A devolução deve se dar no prazo de 7 (sete) dias após a rescisão de qualquer CONTRATO DE PRESTAÇÃO DE SERVIÇO DE VALOR ADICIONADO DE ACESSO A INTERNET vinculado a este.<br>&nbsp;<br>Parágrafo Primeiro. O equipamento deve ser entregue no endereço comercial da COMODANTE.<br>&nbsp;<br>Parágrafo Segundo. No caso da não devolução dos equipamentos dentro do prazo estipulado, fica acordada o aceite da condição de compra por parte do COMODATÁRIO, dos equipamentos disponibilizados pelo COMODANTE, pelo preço DE VAREJO ”, desde que efetue o pagamento a vista e não possua outra pendência financeira com o COMODATANTE.<br>&nbsp;<br>3.3 Parágrafo Único. FATURAS VENCIDAS&nbsp; A MAIS DE 60 (SESSENTA DIAS) SERA EMITIDA OREDEM DE RETIRADA DE EQUIPAMENTO OBSERVANDO AS SEGUINTES CLAUSUALAS E PARAGRAFOS: 3.1, 3.2 PARAGRAFO SEGUNDO. <br><br><b>4. CLÁUSULA QUARTA – DO FORO</b><br>&nbsp;<br>4.1 Fica eleito o Foro do domicílio do COMODATÁRIO para dirimir quaisquer questões relativas ao presente Contrato, com renúncia expressa de qualquer outro, por mais privilegiado&nbsp; que seja.<br><br>\n<p style=\"text-align: right\" align=\"right\"><span style=\"font-size: 9pt; font-family: Verdana\">%provedorcidade%, %data%</span></p>\n<p style=\"text-align: justify\"><span style=\"font-size: 9pt; font-family: Verdana\">&nbsp; <br></span></p>\n<div align=\"center\">\n<table class=\"MsoNormalTable\" style=\"border-collapse: collapse;\" border=\"0\" cellpadding=\"0\" cellspacing=\"0\" height=\"64\" width=\"540\">\n    <tbody>\n        <tr>\n            <td style=\"padding-right: 5.4pt; padding-left: 5.4pt; padding-bottom: 0cm; width: 264.5pt; padding-top: 0cm\" align=\"left\" valign=\"top\" width=\"353\">\n            <p class=\"MsoNormal\" style=\"text-align: center\"><span style=\"font-size: 9pt; font-family: Verdana\">_________________________</span></p>\n            </td>\n            <td style=\"padding-right: 5.4pt; padding-left: 5.4pt; padding-bottom: 0cm; width: 264.5pt; padding-top: 0cm\" valign=\"top\" width=\"353\">\n            <p class=\"MsoNormal\" style=\"text-align: center\" align=\"center\"><span style=\"font-size: 9pt; font-family: Verdana\">_____________________________________</span></p>\n            </td>\n        </tr>\n        <tr>\n            <td style=\"padding-right: 5.4pt; padding-left: 5.4pt; padding-bottom: 0cm; width: 264.5pt; padding-top: 0cm\" align=\"left\" valign=\"top\" width=\"353\"><div align=\"center\"><span style=\"font-size: 9pt; font-family: Verdana\"> %</span><span style=\"font-size: 9pt; font-family: Verdana\"><span style=\"font-size: 9pt; font-family: Verdana\">provedornome</span>%</span><br><span style=\"font-size: 9pt; font-family: Verdana\"></span></div><div align=\"center\"><span style=\"font-size: 9pt; font-family: Verdana\">COMODANTE</span></div></td>\n            <td style=\"padding-right: 5.4pt; padding-left: 5.4pt; padding-bottom: 0cm; width: 264.5pt; padding-top: 0cm\" valign=\"top\