DROP PROCEDURE IF EXISTS `altera_inforpg`$$
CREATE DEFINER=`provedor_fc`@`localhost` PROCEDURE `altera_inforpg` (IN `id_cliente` INT)  NO SQL
BEGIN
	declare valorpago float;
