DROP FUNCTION IF EXISTS `ADD_DATA_UTIL`$$
CREATE DEFINER=`provedor_fc`@`localhost` FUNCTION `ADD_DATA_UTIL` (`datain` DATE, `cidade` VARCHAR(255), `uf` VARCHAR(2)) RETURNS DATE NO SQL
BEGIN
	declare diaUtil boolean default false;
	declare newData date;
	SET newData = datain;
    SET diaUtil = DIA_UTIL(newData,cidade,uf);
 	WHILE(!diaUtil) DO
        SET newData = DATE_ADD(newData, INTERVAL 1 DAY);
        SET diaUtil = DIA_UTIL(newData,cidade,uf);
    END WHILE;
	RETURN newData;
END$$

DROP FUNCTION IF EXISTS `ADD_DIAS_UTEIS`$$
CREATE DEFINER=`provedor_fc`@`localhost` FUNCTION `ADD_DIAS_UTEIS` (`data_i` DATE, `diasuteis` INT(3), `cidade` VARCHAR(255), `uf` VARCHAR(2)) RETURNS DATE NO SQL
BEGIN
	declare newData date;
	declare i int(3) default 0;
	SET newData = data_i;
    WHILE(diasuteis>i) DO
		SET newData = DATE_ADD(newData, INTERVAL 1 DAY);
      	IF (DIA_UTIL(newData,cidade,uf)) THEN
        	SET i = i+1;
        END IF;
	END WHILE;
	RETURN newData;
END$$

DROP FUNCTION IF EXISTS `DATA_PASCOA`$$
CREATE DEFINER=`provedor_fc`@`localhost` FUNCTION `DATA_PASCOA` (`ano` INT) RETURNS DATE NO SQL
BEGIN
	  	declare A INT;
    declare M INT; 
    declare D INT;  
    declare C INT;  
    declare I INT;  
    declare J INT;  
    declare K INT;  
    declare L INT;  
    declare N INT;
		SET A = ano;
		SET C = TRUNCATE(A/100,0);
	SET N = A-(19*TRUNCATE(A/19,0));
	SET K = TRUNCATE((C-17)/25,0);
	SET I = C-TRUNCATE(C/4,0)-TRUNCATE((C-K)/3,0)+19*N+15;
	SET I = I-30*(TRUNCATE(I/30,0));
	SET I = I-(TRUNCATE(I/28,0))*(1-(TRUNCATE(1/28,0))*(TRUNCATE(29/(I+1),0))*(TRUNCATE((21-N)/11,0)));
	SET J = A+TRUNCATE(A/4,0)+I+2-C+TRUNCATE(C/4,0);
	SET J = J-7*TRUNCATE(J/7,0);
	SET L = I-J;
	SET M = 3+TRUNCATE((L+40)/44,0);
	SET D = L+28-(31*TRUNCATE(M/4,0));
	RETURN (STR_TO_DATE(CONCAT(LPAD(A, 4, 0),'-',LPAD(M, 2, 0),'-',LPAD(D, 2, 0)), '%Y-%m-%d'));
END$$

DROP FUNCTION IF EXISTS `DATA_UTIL`$$
CREATE DEFINER=`provedor_fc`@`localhost` FUNCTION `DATA_UTIL` (`data` DATE, `cidade` VARCHAR(255), `uf` VARCHAR(2)) RETURNS DATE NO SQL
BEGIN
	declare diaUtil boolean;
	declare newData date;
	declare dias int(2) default 0;
	SET newData = data;
		SET diaUtil = DIA_UTIL(newData,cidade,uf);
    WHILE(!diaUtil) DO
        IF (dias > 10) THEN
        	SET diaUtil = true;
        END IF;
        SET dias = dias+1;
		SET newData = DATE_ADD(newData, INTERVAL 1 DAY);
      	SET diaUtil = DIA_UTIL(newData,cidade,uf);
    END WHILE;
	RETURN newData;
END$$

DROP FUNCTION IF EXISTS `DIAS_UTEIS`$$
CREATE DEFINER=`provedor_fc`@`localhost` FUNCTION `DIAS_UTEIS` (`data_i` DATE, `data_f` DATE, `cidade` VARCHAR(255), `uf` VARCHAR(2)) RETURNS INT(11) NO SQL
BEGIN
	declare newData date;
	declare dias int(3) default 0;
	declare diasuteis int(3) default 0;
	declare i int(3) default 0;
	SET newData = data_i;
		SET dias = DATEDIFF(data_f,data_i);
    WHILE(dias>i) DO
		SET newData = DATE_ADD(newData, INTERVAL i DAY);
      	IF (DIA_UTIL(newData,cidade,uf)) THEN
        	SET diasuteis = diasuteis+1;
        END IF;
        SET i = i+1;
	END WHILE;
	RETURN diasuteis;
END$$

DROP FUNCTION IF EXISTS `DIA_UTIL`$$
CREATE DEFINER=`provedor_fc`@`localhost` FUNCTION `DIA_UTIL` (`datain` DATE, `cidade` VARCHAR(255), `uf` VARCHAR(2)) RETURNS TINYINT(4) NO SQL
BEGIN
	declare textout boolean DEFAULT false;
	declare ano INT; 
	declare mes INT; 
	declare dia INT; 
	declare dPascoa date; 
    IF (datain = '') THEN 
       SET datain=CURDATE();
    END IF;
	IF ( DAYOFWEEK(datain) > 1 AND DAYOFWEEK(datain) < 7 ) THEN
		SET ano = SPLIT_STRING(datain , '-' , '1');
        SET mes = SPLIT_STRING(datain , '-' , '2');
        SET dia = SPLIT_STRING(datain , '-' , '3');
        SET textout=(SELECT IF((SELECT COUNT(*) FROM `fc_feriados` WHERE `dia_feriadosfc` = dia AND `mes_feriadosfc` = mes AND `sem_expediente_feriadosfc`='on')>0,false,true));
        IF(textout) THEN 
            SET dPascoa = DATA_PASCOA(ano);
            IF (datain < dPascoa) THEN
            	IF (datain = DATE_SUB(dPascoa, INTERVAL 2 DAY )) THEN                 	SET textout=false;
                ELSEIF (datain = DATE_SUB(dPascoa, INTERVAL 46 DAY )) THEN                 	SET textout=false;
                ELSEIF (datain = DATE_SUB(dPascoa, INTERVAL 47 DAY )) THEN                 	SET textout=false;
                ELSE
                 	SET textout=true;               
 				END IF;              
            ELSEIF (datain = DATE_ADD(dPascoa, INTERVAL 60 DAY )) THEN                 SET textout=false;
          	ELSE
                SET textout=true;  
 			END IF; 
      	END IF;
 	END IF;
	RETURN textout;
END$$

DROP FUNCTION IF EXISTS `FERIADOS`$$
CREATE DEFINER=`provedor_fc`@`localhost` FUNCTION `FERIADOS` (`data` DATE, `cidade` VARCHAR(255), `uf` VARCHAR(2), `expediente` VARCHAR(2)) RETURNS VARCHAR(255) CHARSET latin1 NO SQL
BEGIN
	declare text varchar(255);
  	declare done INT DEFAULT 0;
	declare NOME varchar(255);
	declare EXPD varchar(2);
	declare ano INT; 
	declare mes INT; 
	declare dia INT; 
    declare fPascoa date; 
    declare fPaixao date;
	declare fCinzas date;
	declare fCarnaval date;
	declare fCorpusChristi date;
	SET ano = SPLIT_STRING(datain , '-' , '1');
	SET mes = SPLIT_STRING(datain , '-' , '2');
	SET dia = SPLIT_STRING(datain , '-' , '3');
	SET fPascoa = DATA_PASCOA(ano);
	SET fPaixao = DATE_SUB(fPascoa, INTERVAL 2 DAY );
	SET fCinzas = DATE_SUB(fPascoa, INTERVAL 46 DAY );
	SET fCarnaval = DATE_SUB(fPascoa, INTERVAL 47 DAY );
	SET fCorpusChristi = DATE_ADD(fPascoa, INTERVAL 60 DAY );
	CASE datain
		WHEN fPascoa THEN 
			SET text='Pascoa;on';
		WHEN fPaixao THEN 
			SET text='Sexta-Feira da Paixao;on';
		WHEN fCinzas THEN 
			SET text='Quarta-Feira de Cinzas;on';
		WHEN fCarnaval THEN 
			SET text='Carnaval;on';
		WHEN fCorpusChristi THEN 
			SET text='Cospus Christi;on';
		ELSE
			BEGIN
				SET text='';
			END;
	END CASE;
        IF ( text = '') THEN
    	SET text=(SELECT GROUP_CONCAT(CONCAT(`descricao_feriadosfc`,'|',`sem_expediente_feriadosfc`)) FROM `fc_feriados` WHERE `dia_feriadosfc` = dia AND `mes_feriadosfc` = mes AND `sem_expediente_feriadosfc`='on' group by `dia_feriadosfc`,`mes_feriadosfc`);
	END IF;
    	RETURN text;
END$$

