DROP FUNCTION IF EXISTS `SET_VAR`$$
CREATE DEFINER=`provedor_fc`@`localhost` FUNCTION `SET_VAR` (`DEBITO_ATUAL` FLOAT, `DEBITO_ANTERIOR` FLOAT, `CREDITO` FLOAT) RETURNS FLOAT NO SQL
BEGIN
	DECLARE SALDO FLOAT;
    SET SALDO=(CREDITO - DEBITO_ANTERIOR);
    IF(SALDO >= DEBITO_ATUAL) THEN
    	RETURN DEBITO_ATUAL;
    ELSE
        IF(SALDO <= 0) THEN
            return 0;
        ELSE
            RETURN SALDO;
        END IF;
    END IF;
END$$

DROP FUNCTION IF EXISTS `SPLIT_STRING`$$
CREATE DEFINER=`provedor_facil`@`localhost` FUNCTION `SPLIT_STRING`(`str` VARCHAR(255), `delim` VARCHAR(12), `pos` INT) RETURNS varchar(255) CHARSET latin1
    DETERMINISTIC
BEGIN
	  	declare text varchar(255);
		SET text=REPLACE(SUBSTRING(SUBSTRING_INDEX(str, delim, pos),
LENGTH(SUBSTRING_INDEX(str, delim, pos-1)) + 1),
delim, '');
		IF(text='') THEN
		RETURN NULL;
	ELSE
		RETURN text;
	END IF;
END$$

