DROP TRIGGER IF EXISTS `BLOQUEIO_INSERT`;
DELIMITER $$
CREATE TRIGGER `BLOQUEIO_INSERT` AFTER INSERT ON `fc_bloqueios` FOR EACH ROW BEGIN
	declare ACAO VARCHAR(255) DEFAULT 'nada feito';
	IF(new.exe_bloqueiosfc='on') THEN
		call exe_bloqueio_desbloqueio('bloqueado',new.id_cliente_bloqueiosfc, new.id_provedor);
       	SET ACAO=CONCAT('call exe_bloqueio_desbloqueio(bloquear', new.id_bloqueiosfc,',', new.id_cliente_bloqueiosfc,',', new.id_provedor,')');
	END IF;
	IF(new.exe_fim_bloqueiosfc='on') THEN
		call exe_bloqueio_desbloqueio('ativo',new.id_cliente_bloqueiosfc, new.id_provedor);
		SET ACAO=CONCAT('call exe_bloqueio_desbloqueio(desbloquear', new.id_bloqueiosfc,',', new.id_cliente_bloqueiosfc,',', new.id_provedor,')');
	END IF;
    -- tipo = 'ativo' OR tipo = 'bloqueado'END
$$
DELIMITER ;
