	declare ACAO VARCHAR(255) DEFAULT 'nada feito';
	IF(new.exe_bloqueiosfc='on' AND (SELECT `exe_bloqueiosfc` FROM `fc_bloqueios` WHERE `id_bloqueiosfc`=old.id_bloqueiosfc)='') THEN
    	call exe_bloqueio_desbloqueio('bloqueado',old.id_cliente_bloqueiosfc, old.id_provedor);
        SET ACAO=CONCAT('call exe_bloqueio_desbloqueio(bloquear:',old.id_cliente_bloqueiosfc,',', old.id_provedor,')');
	END IF;
	IF(new.exe_fim_bloqueiosfc='on' AND (SELECT `exe_fim_bloqueiosfc` FROM `fc_bloqueios` WHERE `id_bloqueiosfc`=old.id_bloqueiosfc)='') THEN
		call exe_bloqueio_desbloqueio('ativo',old.id_cliente_bloqueiosfc, old.id_provedor);
        SET ACAO=CONCAT('call exe_bloqueio_desbloqueio(desbloquear:',old.id_cliente_bloqueiosfc,',', old.id_provedor,')');
	END IF;
END
$$
DELIMITER ;

